import React from "react";
import AppLayout from "../components/AppLayout";

const Signup = () => {
  return (
    <AppLayout>
      <div>회원가입 페이지</div>
    </AppLayout>
  );
};

export default Signup;

// 처음 누를 땐 약간 느렸다가, 그 뒤에 누를 때는 점점 속도가 빨라지는 것을 알 수 있다. 
// 처음 빌드 시 링크를 클릭하면 느린 것이 정상이다. 왜냐하면 현재 개발 모드이기 때문인데, 개발 모드가 느린편이다. 하지만 이후 배포 모드로 바꿀 때 느림 현상이 사라진다.
